import React from 'react'

const DogList = ({dogs}) => {
    console.log(dogs)
    return(
    <>
        <h1>Dog List</h1>
        {dogs.map(dog => 
        <div>
            <h1>{dog.name}</h1>
            <img src={require(`./${dog.src}.jpg`)} alt='image of dog'></img>
        </div>
        )}
    </>
    )
}

export default DogList;
